	fontFamily: 'serif',
	textAlign: 'center',
	padding: '100px',
	textShadow: '7px 2px black',
	marginTop: '100px',
};

const Contact = () => {
	let navigate = useNavigate();
	return (
		<div style={mystyle}>
			<h1>Contact Information</h1> <br />
			<h2>Please reach us @www.burgernbite.com</h2>
			<h3>Contact us with: 000123456</h3>

			<br />
						<br />
						<button type='button' className='btn btn-primary' onClick={()=> {navigate('/')}}>
							Back to Homepage
						</button>
		</div>
	);
};

export default Contact;
